import React from "react";
import { BrowserRouter as Router } from "react-router";
import { Link } from "react-router-dom";
import Button from "./Button";

export default class Login extends React.Component {
  render() {
    return (
      <div>
        <Router>
          <Link to="/login">
            <Button>Log in</Button>
          </Link>
          <Link to="/signin">
            <Button>Log in</Button>
          </Link>
        </Router>
      </div>
    );
  }
}
